data.value:
Brugeren skal udstyre softwaren og softwarens funktioner (herunder, men ikke begrænset til, oprettelse af nye instanser) med den hardware- og softwarekonfiguration, som brugeren har brug for.
Brugerne er ansvarlige for de relevante gebyrer for brug af telefon og bredbånd, der skal betales efter tilslutning til internettet.
Brugeren bærer det juridiske ansvar for adfærden, begivenheden og resultatet forårsaget af brugen af denne software.
Eventuelle transaktioner og tvister mellem brugere og andre uautoriserede uofficielle personer har intet at gøre med udvikleren.
Brugeren skal overholde de relevante love og regler i Folkerepublikken Kina (hvis brugeren er en bruger uden for Folkerepublikken Kina, skal brugeren også overholde love og regler i det land eller den region, som brugeren tilhører).
Brugeren må ikke bruge softwaren (eller nogle af softwarens funktioner og funktioner) til at deltage i ulovlige handlinger og må ikke bruge de relevante processer og tjenester, der er forbundet med softwaren, til at deltage i ulovlige handlinger, og konsekvenserne af eventuelle handlinger må ikke være relateret til udvikleren.
Brugerne bærer deres eget juridiske ansvar i forbindelse med indholdet af de oplysninger, de offentliggør. Brugeren må ikke indlæse, offentliggøre eller formidle noget af følgende indhold i softwaren, processerne og tjenesterne i forbindelse med driften af softwaren og må ikke offentliggøre noget af følgende indhold i nogen form：

at modsætte sig de grundlæggende principper, der er fastsat i Folkerepublikken Kinas forfatning;
bringe den nationale sikkerhed i fare, afsløre statshemmeligheder, undergrave statsmagten eller underminere den nationale enhed;
skade statens ære og interesser;
tilskyndelse til etnisk had, etnisk diskrimination eller underminering af etnisk enhed;
underminere nationale religiøse politikker, forfægte kulter og feudal overtro;
sprede rygter, forstyrre den sociale orden eller underminere den sociale stabilitet;
Udbredelse af uanstændigheder, pornografi, hasardspil, vold, mord, terror eller tilskyndelse til forbrydelser;
fornærmelse eller bagvaskelse af andre, krænkelse af andres lovlige rettigheder og interesser;
Indeholder andet indhold, som Folkerepublikken Kina har forbudt ved love eller administrative bestemmelser.
Medmindre det er tilladt ved lov eller med skriftlig tilladelse fra udvikleren, må brugere ikke deltage i nogen af følgende handlinger：
Ulovlig eller upassende brug af softwaren og tjenesterne;
Beskadige den normale drift af softwaresystemet eller webstedet, bevidst sprede computervirus og andre destruktive programmer;
Tage enhver unormal brugsadfærd, der kan påvirke softwarens netværkstjenester (herunder, men ikke begrænset til, at beskadige, angribe serveren eller overbelaste serveren osv.);
Slet oplysningerne om ophavsret på softwaren og dens kopier.

Hvis brugeren begår adfærd, der overtræder love og regler eller overtræder bestemmelserne i denne aftale, har udvikleren ret til at træffe foranstaltninger mod brugeren i henhold til situationens alvor, i overensstemmelse med denne aftale og love og regler, herunder, men ikke begrænset til, opsigelse af tjenester. Hvis omstændighederne er alvorlige, vil de blive overført til de relevante administrative organer med henblik på administrativ straf eller efterforsket for strafferetligt ansvar.

Hvis du accepterer disse brugsbetingelser og bruger softwarens onlinetjenester, indsamler vi følgende oplysninger：
IP-adressen på den enhed, som softwaren kører på (som muligvis ikke er den korrekte adresse);
Nogle systemoplysninger om det udstyr, som softwaren fungerer på;
Når softwaren går ned, kan logfilerne for den software, der kører på systemet (inklusive nogle systemoplysninger), uploades med brugerens samtykke for at hjælpe med at løse problemet og forbedre softwaren.
Andre oplysninger, der vil blive uploadet med brugerens samtykke (som angivet i softwaren).

1. Suspension og opsigelse af brugerens tjeneste

Hvis brugeren offentliggør ulovlige oplysninger, alvorligt krænker social moral eller overtræder lovens forbud, skal udvikleren opsige leveringen af tjenester til brugeren;
Hvis brugeren begår en upassende handling, når han accepterer softwaretjenesten, har udvikleren ret til at opsige den tjeneste, der leveres til brugeren (de specifikke omstændigheder ved den upassende adfærd er tydeligt angivet i denne aftale);
Hvis brugeren bruger en ændret version af softwaren fra en tredjepart, bærer brugeren sin egen risiko og sit juridiske ansvar.

2. Suspension, suspension og opsigelse af softwaren og tjenesterne：

I tilfælde af en af følgende omstændigheder har udvikleren ret til at opsige eller afbryde hele eller dele af softwarens tjenester, og udvikleren er ikke ansvarlig over for brugeren eller nogen tredjepart for den ulejlighed eller skade, der er forårsaget deraf：

a. som krævet af softwaren og tjenesterne;
b. Manglende funktion på grund af beskadigelse af serveren;
c. På grund af pludselig svigt af software- og hardwareudstyr og elektronisk kommunikationsudstyr;
d. på grund af netværksudbyderlinje eller andre fejl;
e. på grund af politiske overvejelser
f. Tredjepartsårsager eller andre force majeure-omstændigheder.

Udvikleren forbeholder sig ret til at opsige eller delvist opsige softwaren og tjenesterne, når det skønnes nødvendigt, og udvikleren kan underrette brugeren i form af en meddelelse, men udvikleren er ikke ansvarlig for eventuelle tab, der påføres brugeren.

Denne aftale er underlagt Folkerepublikken Kinas lovgivning uden hensyn til alle lovvalgsregler;
Udviklerens undladelse af at udøve, undlade at udøve rettidigt eller fuldt ud udøve de rettigheder, der nydes i henhold til denne aftale eller i overensstemmelse med loven, skal ikke anses for at være et afkald på udøvelsen af sådanne rettigheder, og det skal heller ikke påvirke udviklerens udøvelse af sådanne rettigheder i fremtiden;
I det omfang loven tillader det, har udvikleren ret til at fortolke vilkårene i denne aftale;
Brugere kan klage og rapportere alle former for overtrædelser af love og regler via e-mail, send venligst e-mailen til services@mcsl.com.cn.
